Not sure if it's worth it, but we can reverse these conditions to move the expected one first.
Note also that there's a type in the `unlikely` condition. It's probably always false.
```suggestion
        if (likely(size == 1)) {
            char *data = PyBytes_AsString(c);
            if (unlikely(!data)) return -1;
            return (unsigned char) data[0];
        }
        else if (unlikely(size < 0)) return -1;
```

